import React, { Component } from 'react';

import {
    OwpTextField,
    OwpButton,
    OwpSelectField,
    OwpDialog,
    OwpMessage,
    OwpTreeGrid,
    OwpSearchDateTimePickerMulti,
    OwpDateTimePicker,
} from 'owp/wrapper';

import {
    AppBar,
    Button,
    Dialog,
    DialogActions,
    DialogContent,
    DialogContentText,
    Toolbar,
    Typography,
    withStyles,
} from '@material-ui/core';
import classNames from 'classnames';
import TextField from '@material-ui/core/TextField';

import Formsy from 'formsy-react';
import { mutate } from 'owp/api';
import * as TGEvent from 'owp/TGEvent';



const styles = theme => ({
    textField: {
        marginLeft : theme.spacing.unit,
        marginRight: theme.spacing.unit,
        width      : '100%'
    },
    button: {
        margin: theme.spacing.unit,
        whiteSpace: 'noWrap'
    },
    leftIcon : {
        marginRight: theme.spacing.unit
    },
    rightIcon: {
        marginLeft: theme.spacing.unit
    },
    iconSmall: {
        fontSize: 16
    },
});

class DialogReweighing extends Component {

    state = {
        stateDialogReweighing: false
    };

    handleChange = event => {
        this.setState({selectedValue: event.target.value});
    };

    openDialogReweighing = () => {
        this.setState({stateDialogReweighing: true});
    };

    closeDialogReweighing = () => {
        this.setState({stateDialogReweighing: false});
    };

    render()
    {
        const {classes} = this.props;

        return (
            <div>
                <img src="assets\images\sam\sk_sam02.jpg" className="cp" style={{width:'75%'}} onClick={this.openDialogReweighing}/>
                
                <Dialog
                    open={this.state.stateDialogReweighing}
                    onClose={this.closeDialogReweighing}
                    aria-labelledby="form-dialog-title"
                    maxWidth={'lg'}
                >
                    <AppBar position="static">
                        <Toolbar className="flex w-full" style={{backgroundColor:'#fff'}}>
                            <h6 className="dialog_stitle">
                            공정진행
                            </h6>
                        </Toolbar>
                    </AppBar>

                    <DialogContent classes={{root: "p-16 pb-0 sm:p-24 sm:pb-0"}}>

                        <DialogContentText>
                            <div className="row w-full">
                                <img src="assets\images\sam\sk_sam02.jpg" className="cp" style={{width:'100%'}}/>
                            </div>
                        </DialogContentText>
                    </DialogContent>

                    <DialogActions>
                        <OwpButton color="secondary" variant="outlined" onClick={this.closeDialogReweighing}>
                        닫기
                        </OwpButton>
                    </DialogActions>
                </Dialog>
            </div>
        )
    };
}

export default withStyles(styles, {withTheme: true})(DialogReweighing);
